css:
.editor-colors {
  background-color: #ffffff;
  color: #000000;
}
.editor {
  background-color: #ffffff;
  color: #000000;
}
.editor .wrap-guide {
  background-color: #e0e0e0;
}
.editor .indent-guide {
  color: #e0e0e0;
}
.editor .invisible-character {
  color: #7f7f7f;
}
.editor .gutter {
  background-color: #ffffff;
  border-right: 1px solid #e0e0e0;
  color: #e0e0e0;
}
.editor .gutter .line-number {
  padding: 0 0.25em 0 0.5em;
}
.editor .gutter .line-number.cursor-line {
  background-color: #e0e0e0;
  color: #c5c8c6;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #b4b7b4;
}
.editor .scroll-view {
  padding-left: 10px;
}
.editor .invisible {
  color: #000000;
}
.editor .cursor {
  color: #1d1f21;
}
.editor .selection .region {
  background-color: #cfd5d1;
}
.comment {
  color: #435138;
}
.comment .storage.todo,
.comment .storage.fixme {
  color: #435138;
  font-weight: 600;
}
.entity.name.type {
  color: #476a97;
}
.entity.other.inherited-class {
  color: #476a97;
}
.keyword {
  color: #262c6a;
}
.keyword.control {
  color: #262c6a;
}
.keyword.operator {
  color: #000000;
}
.keyword.operator.new {
  color: #262c6a;
}
.keyword.operator.sizeof {
  color: #262c6a;
}
.keyword.other.unit {
  color: #476a97;
}
.storage {
  color: #262c6a;
}
.constant {
  color: #476a97;
}
.variable {
  color: #000000;
}
.variable.interpolation {
  color: #a3685a;
}
.variable.parameter.function {
  color: #000000;
}
.variable.other.less {
  color: #476a97;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #ffffff;
}
.string {
  color: #702c51;
}
.string.regexp {
  color: #476a97;
}
.string.other.link {
  color: #12139f;
}
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #262c6a;
}
.punctuation.section.embedded {
  color: #262c6a;
}
.punctuation.inheritance.separator {
  color: #000000;
}
.support.class {
  color: #476a97;
}
.support.function {
  color: #476a97;
}
.support.property-name {
  color: #262c6a;
}
.support.sys-types {
  color: #262c6a;
}
.support.stdint {
  color: #262c6a;
}
.entity.name.function {
  color: #476a97;
}
.entity.name.class,
.entity.name.type.class {
  color: #476a97;
}
.entity.name.section {
  color: #262c6a;
}
.entity.name.tag {
  color: #262c6a;
}
.entity.other.attribute-name {
  color: #476a97;
}
.entity.other.attribute-name.css.class {
  color: #000000;
}
.meta.class {
  color: #476a97;
}
.meta.link {
  color: #12139f;
}
.meta.require {
  color: #262c6a;
}
.meta.selector {
  color: #476a97;
}
.meta.separator {
  background-color: #373b41;
  color: #000000;
}
.meta.tag {
  color: #000000;
}
.meta.preprocessor {
  color: #262c6a;
}
.none {
  color: #000000;
}
.markup.bold {
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #262c6a;
}
.source.gfm .markup.link {
  color: #12139f;
}
.source.gfm .link .entity {
  color: #476a97;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
